script: |
  super -f text -I q1666.spq | sort > q1666.out

inputs:
  - name: q1666.spq
    data: |
      SELECT - 30 * col2 + - col0 / - 35 FROM tab1 (FORMAT parquet) WHERE NOT - col2 IN ( - + col0 + + 24 / - col1 * 49 / - col0 + - col0 * + 18 );
  - name: tab1

outputs:
  - name: q1666.out
    data: |
      -1768
      -2038
      -2879
